import React from "react";
import "../node_modules/bootstrap/dist/css/bootstrap.min.css";
import FacebookIcon from '@material-ui/icons/Facebook';
import LinkedInIcon from '@material-ui/icons/LinkedIn';
import InstagramIcon from '@material-ui/icons/Instagram';
import TwitterIcon from '@material-ui/icons/Twitter';
import YouTubeIcon from '@material-ui/icons/YouTube';
const Header = () => {

return(
    <>
      <div className="header fixed-top container-fluid">
          <img src="https://assets.materialup.com/uploads/ef2f0ee0-6f32-478c-b160-f52a308ee211/preview" alt="logo" />
          <h1> Google Keep</h1>
          
      </div>
      <div className="follow">follow
      <div className="social_media fixed-top">          
          <FacebookIcon className="icon_f" />
          <LinkedInIcon className="icon_l" />
          <InstagramIcon className="icon_i" />
          <TwitterIcon className="icon_t" />
          <YouTubeIcon className="icon_y" />
          </div>
          </div>
    </>
);
};
export default Header;
